import React, { useState } from "react";
import { useDispatch } from "react-redux";
import * as actions from "../../store/actions/index";
import { useHistory } from "react-router-dom";
import classes from "./NewRecipePanel.module.scss";
import { v4 as uuidv4 } from "uuid";
import InputField from "../UI/InputField/InputField";
import Button from "../UI/Button/Button";

const NewRecipePanel = () => {
	const dispatch = useDispatch();
	const history = useHistory();
	const [recipeNameInput, setRecipeNameInput] = useState("");
	const [recipePreparationTimeInput, setRecipePreparationTimeInput] = useState("");
	const [recipeCookTimeInput, setRecipeCookTimeInput] = useState("");

	const handleRecipeNameInput = (data) => {
		setRecipeNameInput(data);
	};

	const handleRecipePreparationTimeInput = (data) => {
		setRecipePreparationTimeInput(data);
	};

	const handleRecipeCookTimeInput = (data) => {
		setRecipeCookTimeInput(data);
	};

	const handleRecipeCreate = (event) => {
		let data = {};
		if (recipeNameInput !== "" && recipePreparationTimeInput !== "" && recipeCookTimeInput !== "") {
			data.id = uuidv4();
			data.name = recipeNameInput;
			data.image = "";
			data.preparation_time = recipePreparationTimeInput;
			data.cook_time = recipeCookTimeInput;
			dispatch(actions.createRecipe(data));
			setRecipeNameInput(null);
			setRecipePreparationTimeInput(null);
			setRecipeCookTimeInput(null);
			history.push("/");
		}
	};

	return (
		<div className={classes.NewRecipePanel}>
			<h1>New Recipe</h1>
			<form>
				<InputField
					handleInputSelection={handleRecipeNameInput}
					inputType="text"
					inputData={recipeNameInput}
					placeHolder="Recipe Name"
				/>
				<InputField
					handleInputSelection={handleRecipePreparationTimeInput}
					inputType="number"
					inputData={recipePreparationTimeInput}
					placeHolder="Preparation Time (minutes)"
				/>
				<InputField
					handleInputSelection={handleRecipeCookTimeInput}
					inputType="number"
					inputData={recipeCookTimeInput}
					placeHolder="Cook Time (minutes)"
				/>
			</form>
			<Button
				buttonText="New Recipe"
				handleButton={handleRecipeCreate}
			>
				New Recipe
			</Button>
		</div>
	);
};

export default NewRecipePanel;
